import Footer from "./components/Footer";
import Wrapper from "./components/Wrapper";

function App() {
  return (
    <Router>
      <div>
        <Navbar />
        <Wrapper>
          <Route exact path="/" component={About} />
          <Route exact path="/discover" component={Discover} />
          <Route exact path="/about" component={About} />

        </Wrapper>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
